package main

import "fmt"

func lengthOfLongestSubstring(s string) int {
	var result int
	if len(s) == 0 {
		return 0
	}
	if len(s) == 1 {
		return 1
	}
	chIndex := make(map[byte]([]int))

	for i, c := range []byte(s) {
		info, ok := chIndex[c]
		if !ok {
			var indexs []int
			indexs = append(indexs, i)
			chIndex[c] = indexs
		}
		info = append(info, i)
		chIndex[c] = info
	}
	var lastIndex int
	var restartIndex int
	lastIndex = len(s) - 1
	restartIndex = 0
	result = 0
	index := 0
	base := 0

	for ; index < len(s); index++ {
		if index >= lastIndex {
			if lastIndex-base+1 > result {
				result = lastIndex - base + 1
			}

			if lastIndex == len(s)-1 {
				break
			}
			base = restartIndex + 1
			c := ([]byte(s))[base]
			info, _ := chIndex[c]
			for j, val := range info {
				if val == base {
					if (j + 1) == len(info) {
						lastIndex = len(s) - 1
						break
					} else {
						lastIndex = info[j+1] - 1
						break
					}
				}
			}

			continue
		}

		c := ([]byte(s))[index]
		info, _ := chIndex[c]
		for j, val := range info {
			if val == index {
				if (j + 1) == len(info) {
					break
				} else {
					if info[j+1] < lastIndex {
						lastIndex = info[j+1] - 1
						restartIndex = index
					}
				}
				break
			}
		}
	}
	return result
}

